import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [alertInfo, setAlertInfo] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes(".")) {
      const [objectName, field] = name.split(".");
      setFormData((prevData) => ({
        ...prevData,
        [objectName]: {
          ...prevData[objectName],
          [field]: value,
        },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    if (selectedDate > currentDate) {
      setAlertInfo({ type: 'danger', message: 'La fecha de nacimiento no puede ser futura.' });
      return;
    }

    if (year < 1900 || year > 2100) {
      setAlertInfo({ type: 'danger', message: 'El año de nacimiento debe estar entre 1900 y 2100.' });
      return;
    }

    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
      usuario: {
        ...formData.usuario,
        id: {
          login: formData.usuario.login,
          persona: null,
        },
      },
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      let responseData;
      const contentType = response.headers.get("content-type");
      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      } else {
        responseData = await response.text();
      }

      if (response.ok) {
        setAlertInfo({ type: 'success', message: typeof responseData === 'object' ? responseData.message : responseData });
      } else {
        // Manejo de errores específicos
        if (responseData.message && responseData.message.includes("ya existe")) {
          if (responseData.message.includes("identificación")) {
            setAlertInfo({ type: 'danger', message: 'La identificación ya está registrada.' });
          } else if (responseData.message.includes("correo")) {
            setAlertInfo({ type: 'danger', message: 'El correo electrónico ya está registrado.' });
          } else if (responseData.message.includes("usuario")) {
            setAlertInfo({ type: 'danger', message: 'El nombre de usuario ya está en uso.' });
          } else {
            setAlertInfo({ type: 'danger', message: responseData.message });
          }
        } else {
          setAlertInfo({ type: 'danger', message: typeof responseData === 'object' ? responseData.message : responseData });
        }
      }
    } catch (error) {
      console.error("Error:", error);
      setAlertInfo({ type: 'danger', message: 'Error en la solicitud.' });
    }
  };

  return (
    <div className="container-fluid py-5" style={{ 
      background: 'linear-gradient(to right, #212531, #c9b1ff)', 
      minHeight: '100vh'
    }}>
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header bg-primary text-white">
              <h2 className="mb-0">Registrar Persona</h2>
            </div>
            <div className="card-body">
              {alertInfo && (
                <div className={`alert alert-${alertInfo.type}`} role="alert">
                  {alertInfo.message}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                {/* El resto del formulario permanece igual */}
                {/* ... */}
                <div className="d-flex justify-content-between mt-4">
                  <button 
                    type="submit" 
                    className="btn btn-primary"
                  >
                    Guardar
                  </button>
                  <button 
                    type="button" 
                    className="btn btn-secondary" 
                    onClick={() => console.log("Return to login")}
                  >
                    Regresar a Login
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
